import React from "react";
import "./Product.css";

function Product() {
  return (
    <div>
      <p className="product-title"></p>
      <h4 className="product-price"></h4>

      <img src="" alt="Image" className="product-image">
        Image of Product
      </img>
      <button className="product-button">Add To Basket</button>
    </div>
  );
}

export default Product;
